import React, { Component } from 'react';
import { 
  WriterWrapper,
  WriterTitle,
  WriterSwitch,
  WriterItem,
  WriterName,
  WriterCount,
  AddFocus
} from '../style';

class Writer extends Component {
  render() { 
    return (
      <WriterWrapper>
        <WriterTitle>
          推荐作者
          <WriterSwitch>
            换一批
          </WriterSwitch>
        </WriterTitle>
        <WriterItem>
          <img className="writer-img" alt="" src="https://upload.jianshu.io/users/upload_avatars/2594450/a5bbf755-a88e-42da-9eb7-eb4c0e895683.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/96/h/96/format/webp" />
          <WriterName>小托卡</WriterName>
          <WriterCount>写了296.8k字 · 1.5k喜欢</WriterCount>
          <Follow> ➕关注</Follow>
        </WriterItem>
        <WriterItem>

        </WriterItem>
      </WriterWrapper>
    );
  }
}

export default Writer;
